    private static SZDealDto parseOneHand(String areaName,String html){
        SZDealDto dealDto = new SZDealDto();
        dealDto.setAreaName(areaName);
        Document doc = Jsoup.parse(html);
        Elements dateEles = doc.select("#lblCurTime2");
        Element dateEle = dateEles.get(0);
        Date date = DateUtil.parse(dateEle.text(), "yyyy年MM月dd日");
        dealDto.setDate(date);
        Elements tr = doc.select("tr #TrClientList2");
        Element element = tr.get(0);
        Elements select = element.select("td table tbody tr");
        for (int i = 1; i < select.size(); i++) {
            Element element1 = select.get(i);
            Elements td = element1.select("td");
            if(td.get(0).text().equals("住宅")){
                dealDto.setHouseNum(Integer.valueOf(td.get(1).text()));
            }
            if(td.get(0).text().equals("小计")){
                dealDto.setTotalNum(Integer.valueOf(td.get(1).text()));
                String trim = td.get(3).text().replaceAll(String.valueOf((char) 160),"");
                dealDto.setAvgPrice(Double.valueOf(trim));
            }
        }
        return dealDto;
    }
    
