    private static SZDealDto parseSecondHand(String areaName, String html) {
        SZDealDto dealDto = new SZDealDto();
        dealDto.setAreaName(areaName);
        Document doc = Jsoup.parse(html);
        Elements dateEles = doc.select("#ctl00_ContentPlaceHolder1_lblCurTime1");
        Element dateEle = dateEles.get(0);
        Date date = DateUtil.parse(dateEle.text(), "yyyy年MM月dd日");
        dealDto.setDate(date);
        Elements table = doc.select("table #ctl00_ContentPlaceHolder1_clientList1 tbody");
        Element element = table.get(0);
        Elements select = element.select("tr");
        for (int i = 1; i < select.size(); i++) {
            Element element1 = select.get(i);
            Elements td = element1.select("td");
            if (td.get(0).text().equals("住宅")) {
                String text = td.get(2).text();
                dealDto.setHouseNum(Integer.valueOf(text));
            }
            if (td.get(0).text().equals("小计")) {
                String text = td.get(2).text();
                dealDto.setTotalNum(Integer.valueOf(text));
            }
        }
        return dealDto;
    }

    /*深圳二手房详情数据*/
    public static List<SZDealDto> getSZSecondHandDetail() {
        HttpUtil httpUtil = new HttpUtil();
        Date date=new Date();
        String get = httpUtil.get(secondHandDetailUrl, null);
        ArrayList<SZDealDto> list = new ArrayList<SZDealDto>();
        Document doc = Jsoup.parse(get);
        Elements tables = doc.select("table");
        Element table = tables.get(1);
        Elements trs = table.select("tr");
        Element dateEle = trs.get(0);
        Pattern pattern = Pattern.compile("\\d+年\\d+月\\d+日");
        Matcher matcher = pattern.matcher(dateEle.text());
        if(matcher.find()){
            String group = matcher.group();
            date = DateUtil.parse(group, "yyyy年MM月dd日");
        }
        for (int i = 2; i < trs.size(); i++) {
            SZDealDto dealDto = new SZDealDto();
            dealDto.setDate(date);
            Element tr = trs.get(i);
            Elements tds = tr.select("td");
            dealDto.setMediumName(tds.get(0).text());
            dealDto.setTotalNum(Integer.valueOf(tds.get(1).text()));
            list.add(dealDto);
        }
        return list;
    }
    

    
