    //BigDecimal舍弃小数据点后面的数据，取整
	 public static int multiplicationToInt(String str) {
		 if(StringUtil.isEmpty(str)) {
			 return 0;
		 }
		 BigDecimal bd = new BigDecimal(str);  
		 bd = bd.setScale(0,BigDecimal.ROUND_DOWN);
		return Integer.parseInt(bd.toPlainString()); 
	 }    
	     //四舍五入取2位小数点,浮点转百分比
		 public static String  multiplication2(String str) {
			 if(StringUtil.isEmpty(str)) {
				 return str;
			 }
			 BigDecimal bd = new BigDecimal(str);  
			 BigDecimal b2 = new BigDecimal(100);
			 bd =bd.multiply(b2);
			 bd = bd.setScale(2,BigDecimal.ROUND_HALF_UP);
			return bd.toPlainString(); 
		 }    
		 
	 private static void getParams(String html, HashMap<String, String> hashMap) {
		try {
			if (StringUtils.isBlank(html)) {
				return; 
			}
			Document doc = Jsoup.parse(html);
			Elements eles1 = doc.select("#__VIEWSTATE");
			Elements eles2 = doc.select("#__EVENTVALIDATION");
			Element ele1 = eles1.get(0);
			Element ele2 = eles2.get(0);
			String a = ele1.val();
			String b = ele2.val();
			hashMap.put("__VIEWSTATE", a);
			hashMap.put("__EVENTVALIDATION", b);
		} catch (Exception e) {
			return;
		}
		return;
    }	 
